class HtmlCode {
  static String content =
      "<p style=\"\"><span lang=\"EN-US\" style=\"font-size: 12px;\">The damage done has been enormous. Almost all the inhabitants of the seaside&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12px;\">have been rehoused in a camp in the courtyard of the Saint Joseph church.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12px;\">Pestel, a commune in Grand'Anse located 81 kilometers from the town of Les&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12px;\">Cayes, with an area of 261 square kilometers and a population of 90,000&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12px;\">inhabitants, according to data provided by the commune's town hall, was&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12px;\">devastated by the earthquake of August 14th, 2021.</span></p><p style=\"\"><span lang=\"EN-US\" style=\"font-size: 12px;\"><br></span></p><p style=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"entrevistadojpg4.jpg\" style=\"font-size: 1rem; width: 1073px;\"><br></p><p style=\"\"><span style=\"font-weight: 400; font-size: 12px;\">The earthquake hit everyone in Pestel. Wadlet&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">Merant is secretary of the U-Report club in Pestel. When the earth started&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">shaking, he was not at home. It was total panic, he says. \"It was a&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">terrible thing. It was like the end of the world. It was the worst time I've&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">had in Pestel in my life,\" he said.&nbsp;</span><br></p><p style=\"\"><span style=\"font-size: 12px;\"><br></span><span style=\"font-size: 12px;\">Merant's house was damaged. However, as a&nbsp;</span><span style=\"font-size: 12px;\">community leader, he did not allow himself to be discouraged. He came to the&nbsp;</span><span style=\"font-size: 12px;\">rescue of the people in his commune. \"Immediately after the earthquake, I&nbsp;</span><span style=\"font-size: 12px;\">went into my house to get one thing: my U-Report t-shirt. I took it and went&nbsp;</span><span style=\"font-size: 12px;\">out to help the people. I was accompanied by the president, Charnel Bernard,&nbsp;</span><span style=\"font-size: 12px;\">and other members of the U-Report club. In fact, we were together on the ground&nbsp;</span><span style=\"font-size: 12px;\">to pull people out of the rubble,\" explains the 24-year-old man.</span></p><p style=\"\"><span style=\"font-size: 12px;\"><br></span><span style=\"font-size: 12px;\">After their first action, in order to continue&nbsp;</span><span style=\"font-size: 12px;\">helping the population, they took other initiatives. Indeed, they carried out a&nbsp;</span><span style=\"font-size: 12px;\">fundraising campaign via social networks, including Facebook, in order to find&nbsp;</span><span style=\"font-size: 12px;\">money for the acquisition of water boxes to distribute to the victims of the&nbsp;</span><span style=\"font-size: 12px;\">disaster. They went as far as Miragoâne in the Nippes department to get water&nbsp;</span><span style=\"font-size: 12px;\">to help their fellow citizens.&nbsp; The&nbsp;</span><span style=\"font-size: 12px;\">transport was done by sea. All this was done with the support of civil&nbsp;</span><span style=\"font-size: 12px;\">protection, NGOs, and members of the private business sector.</span></p><p style=\"\"><span style=\"font-size: 12px;\"><br></span><img src=\"data:image/jpeg;base64,\" data-filename=\"04.jpg\" style=\"font-size: 1rem; width: 100%;\"><br></p><p style=\"\"><span style=\"font-size: 12px;\">The young people store the water boxes in a&nbsp;</span><span style=\"font-size: 12px;\">warehouse by the sea. On the day of the UNICEF delegation's visit, the&nbsp;</span><span style=\"font-size: 12px;\">U-Reporters conducted two water distribution sessions.&nbsp;&nbsp;One in the morning, in the localities of Grand Chemin, 1st section and Lucière, 2nd section; and the other during the afternoon, in the city center of the courtyard of Saint Joseph's church.</span></p><p style=\"\"><span style=\"font-size: 12px;\"><br></span><span lang=\"EN-US\"><span style=\"font-size: 12px;\">24 hours after the earthquake,&nbsp;</span></span><span lang=\"EN-US\"><span style=\"font-size: 12px;\">Pestel's U-Reporters conducted research to count the number of people who died&nbsp;</span></span><span lang=\"EN-US\"><span style=\"font-size: 12px;\">in the earthquake.&nbsp;</span></span></p><p style=\"\"><span lang=\"EN-US\"><span style=\"font-size: 12px;\"><br></span></span><span style=\"font-size: 12px;\">Also, the earthquake did not only damage&nbsp;</span><span style=\"font-size: 12px;\">the houses of the members of the U-Report club in Pestel.&nbsp; One of them was badly hit in the earthquake.&nbsp;</span><span style=\"font-size: 12px;\">Carlande Bernard almost died if it wasn't for the diligence of these dedicated&nbsp;</span><span style=\"font-size: 12px;\">young people and her immediate family.&nbsp;&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">She is one of the secretaries of the group. \"She had gone to&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">buy for her mother. When the earth shook, the wall where she was fell on&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">her.&nbsp; She came out with two broken legs.&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">A few days later, her situation got really bad. We had done everything to save&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">her life,\" says Merant. Her family arranged to take her to the hospital.&nbsp; Currently, Carlande Bernad is receiving the&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">necessary treatment at the Adventist hospital in Diquini, Carrefour in the&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">western department.</span></p><p style=\"\"><span style=\"font-weight: 400; font-size: 12px;\"><br></span></p><p style=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"05.jpg\" style=\"font-size: 1rem; width: 100%;\"><br></p><p style=\"\"><span style=\"font-size: 12px;\">Almost 8 days after the earthquake, the&nbsp;</span><span style=\"font-size: 12px;\">population had not yet received any help from the state. Only UNICEF has&nbsp;</span><span style=\"font-size: 12px;\">managed to install a water bladder at the town hall in Pestel. &nbsp;Faced with this situation, the president of&nbsp;</span><span style=\"font-size: 12px;\">the U-Report club of Pestel cries out for help. \"The people of Pestel need&nbsp;</span><span style=\"font-size: 12px;\">your help urgently.&nbsp; We don't have food,&nbsp;</span><span style=\"font-size: 12px;\">we don't have enough water and tents.&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">The state is powerless in Pestel. The situation is really serious&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">because people have nothing,\" said the president of U-Report, Chanel&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">Bernard, who says he has used all his economic means to help the population.&nbsp;</span></p><p style=\"\"><span style=\"font-weight: 400; font-size: 12px;\"><br></span><span style=\"font-weight: 400; font-size: 12px;\">It should be recalled that the U-Report club of&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">Pestel was born after an activity of the artist Jean Jean Roosevelt in the area&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">last June.&nbsp; The club is only two&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">months old in the community. This youth group is a model to follow.&nbsp; Madelène Velny is vice-president of the&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">U-Report club in Pestel. She invites young people to join together to work for&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">the well-being of their communities. \"I would like to invite young people&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">to get together to think about the need for their communities. We need to get&nbsp;</span><span style=\"font-weight: 400; font-size: 12px;\">together to help the weakest,\" she says.</span></p><p style=\"\"><br></p><p style=\"\"><img src=\"data:image/jpeg;base64,\" data-filename=\"06.jpg\" style=\"font-size: 1rem; width: 100%;\"><br></p><p style=\"\"><span style=\"font-size: 12px;\">Developed by UNICEF international, U-Report&nbsp;</span><span style=\"font-size: 12px;\">is a free and anonymous digital tool. It encourages and engages young people in&nbsp;</span><span style=\"font-size: 12px;\">civic participation through surveys sent to their phones, via SMS on the&nbsp;</span><span style=\"font-size: 12px;\">shortcode 8090, on Messenger on the U-Report Haiti Facebook page, or on&nbsp;</span><span style=\"font-size: 12px;\">WhatsApp. U-Report engages young people in social and political dialogue&nbsp;</span><span style=\"font-size: 12px;\">through surveys on their daily lives, their problems, and their expectations. As&nbsp;</span><span style=\"font-size: 12px;\">committed citizens, U-Reporters defend their rights and make their voices heard&nbsp;</span><span style=\"font-size: 12px;\">by the general public, the media, and political decision-makers. As of&nbsp;</span><span style=\"font-size: 12px;\">August 24th, more than 34,700 young people have registered with U-Report in Haiti.<br></span><span lang=\"EN-US\" style=\"font-size: 12px;\">&nbsp;<br></span><span data-contrast=\"none\" xml:lang=\"EN-US\" lang=\"EN-US\" class=\"TextRun SCXW19564730 BCX0\" style=\"margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; line-height: 18px;\"><span class=\"NormalTextRun SCXW19564730 BCX0\" style=\"margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-size: 12px;\"><b>Text and Photo Credits: </b>UNICEF Haiti, U-Report Haiti</span></span></p><p style=\"\"><span data-contrast=\"none\" xml:lang=\"EN-US\" lang=\"EN-US\" class=\"TextRun SCXW19564730 BCX0\" style=\"margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; line-height: 18px;\"><span class=\"NormalTextRun SCXW19564730 BCX0\" style=\"margin: 0px; padding: 0px; user-select: text; -webkit-user-drag: none; -webkit-tap-highlight-color: transparent; font-size: 12px;\"></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt;\"><span lang=\"EN-US\" style=\"\"><span style=\"font-size: 12px;\"><b>English Translation: </b></span><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12px;\">Lauréana Thevenet</span><span style=\"font-size: 12px;\">, U-Report Global Volunteer</span></span><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\"><!--[if gte vml 1]><v:shape\r\n id=\"Picture_x0020_2\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" style='width:425.4pt;\r\n height:283.8pt;visibility:visible;mso-wrap-style:square'>\r\n <v:imagedata src=\"file:///C:\\Users\\adria\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image005.jpg\"\r\n  o:title=\"5CDAB9B5\"></v:imagedata>\r\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><!--[if gte vml 1]><v:shape\r\n id=\"Picture_x0020_1\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" style='width:425.1pt;\r\n height:280.2pt;visibility:visible;mso-wrap-style:square'>\r\n <v:imagedata src=\"file:///C:\\Users\\adria\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image007.jpg\"\r\n  o:title=\"2BD97986\"></v:imagedata>\r\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--><span lang=\"EN-US\"><o:p></o:p></span></p><p><span style=\"font-size: 12px;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</span></p>";
